import "./sass/App.scss";
import Bees from "./components/Bee";
import workerImage from "./images/worker.png";
import droneImage from "./images/drone.png";
import queenImage from "./images/queen.png";

function App() {
  return (
    <div className='App'>
      <Bees image={workerImage} name='Workers' />
      <Bees image={droneImage} name='Drones' />
      <Bees image={queenImage} name='The Queen' />
    </div>
  );
}

export default App;
